import React,{Component} from "react";
import facebook from '../images/facebook.png';
import youtube from '../images/youtube.png';
import instagram from '../images/instagram.png';
import chat from '../images/chat.png';

class Footer extends Component{

    render(){
        return(
            <footer style={{backgroundColor:"#E8E8E8",marginTop:"20px",paddingBottom:"20px",paddingTop:"20px",fontSize:"14px",position: "absolute",bottom: "0px"}}>



<div className="container"  >
<div className="row" >
    <div className="col-md-2" ></div>
    <div className="col-md-8">
    <div className='container'>



    <div className="row ">
      <div className="col-md-12 text-center">
      <font style={{color:"#797A7E"}}> About | Jobs | Market | Discovery | Advertise with us | Privacy policy | Contact</font>

          </div>  

  </div>
  <div className="row" style={{marginTop:"10px"}}>
      <div className="col-md-3">
          <font style={{color:"#797A7E"}}><b>Connect</b> <img height="20px" width="20px" src={facebook}/> <img height="20px" width="20px" src={instagram}/> <img height="20px" width="20px" src={youtube}/></font>
      </div>
      <div className="col-md-7"><font style={{color:"#797A7E"}}>Copyright 2020 | Greata ltd | All Rights Reserved</font></div>
      <div className="col-md-2"><img src={chat} width="100%"/></div>
  </div>


</div>
</div>
<div className="col-md-2" ></div>
</div>
</div>


</footer>
        )
    }

}
export default Footer
